  html, body, div, span, applet, object, iframe,

b, u, i, center,

	padding: 0;
	border: 0;
	font-size: 100%;
	font: inherit;

}
ol, ul {

}
blockquote, q {

}

q:before, q:after {

	content: none;
}
table {
	border-collapse: collapse;
	border-spacing: 0;
}

    height:420mm;
    width:297mm;
    margin: 0 auto;
    overflow: hidden;
}

body{

    position: relative;
}

.svg{

    max-width: 95%;
    margin: 0 auto;
}

svg{
    max-width: 100%;
    height: auto;
}

.content{

    font-family: "Poppins", sans-serif;
}

.bold-text{

    text-align: center;
    font-weight: 600;
    margin-bottom: 10mm;
}

.single{
    max-width: 70%;
    line-height: 1.1;
    font-size: 9mm;
    text-align: center;
    margin: 0 auto;
    font-weight: 400;
}

.name-holder{
    position: absolute;
    left: 0;
    right: 0;
    bottom: 10mm;
    font-size: 12mm;
    font-weight: 300;
    padding: 10mm;
    padding-bottom: 0;
    display: flex;
    justify-content: space-between;
}
